let data={sketch:{background:"#FFFFFF"},cells:{columns:50,rows:25,w:40,h:40}};var grid=[],current,stack=[];function setup(){createCanvas(windowWidth,windowHeight),data.cells.w=width/data.cells.columns,data.cells.h=height/data.cells.rows,colorMode(HSB,100);for(let c=0;c<data.cells.rows;c++)for(let e,d=0;d<data.cells.columns;d++)e=new Cell(d,c),grid.push(e);current=grid[0]}function mousePressed(){grid=[],stack=[];for(let c=0;c<data.cells.rows;c++)for(let e,d=0;d<data.cells.columns;d++)e=new Cell(d,c),grid.push(e);current=grid[0]}function draw(){background(0);for(let d=0;d<grid.length;d++)grid[d].show();current.visited=!0,current.highlight();let c=current.checkNeighbors();c?(c.visited=!0,stack.push(current),removeWalls(current,c),current=c):0<stack.length&&(current=stack.pop())}function index(c,d){return 0>c||0>d||c>data.cells.columns-1||d>data.cells.rows-1?-1:c+d*data.cells.columns}function removeWalls(c,d){let e=c.i-d.i;1==e?(c.walls[3]=!1,d.walls[1]=!1):-1==e&&(c.walls[1]=!1,d.walls[3]=!1);let f=c.j-d.j;1==f?(c.walls[0]=!1,d.walls[2]=!1):-1==f&&(c.walls[2]=!1,d.walls[0]=!1)}